import React from 'react';
import ReactDOM from 'react-dom/client';

const lentele=(
  <table border='1'>
    <tr><th>Vardas</th><th>Pavarde</th></tr>
    <tr><td>Jonas</td><td>Jonaitis</td></tr>
    <tr><td>Petras</td><td>Petraitis</td></tr>
    <tr><td>Ona</td><td>Onyte</td></tr>
  </table>
);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(lentele, document.getElementById('root'));
